.go-plus-panel.is-narrow .panel-nav-label {
  display: none;
}
.go-plus-panel {
  position: relative;
  display: flex;
  flex-direction: row;
  -webkit-user-select: none;
}
.go-plus-panel .panel-heading {
  border: none;
  text-align: center;
  flex-direction: column;
  flex: 0 0 auto;
  display: flex;
  align-items: left;
  padding: 0;
  cursor: default;
  background-color: #fff;
}
.go-plus-panel .go-plus-panel-pre {
  white-space: pre;
}
.go-plus-panel .panel-nav {
  border: none;
  flex: 1 1 0;
  padding: 0;
  margin-bottom: -1px;
  border-right: 1px solid transparent;
  white-space: nowrap;
  overflow-x: auto;
}
.go-plus-panel .panel-nav::-webkit-scrollbar {
  display: none;
}
.go-plus-panel .panel-nav-label {
  display: inline;
}
.go-plus-panel .panel-nav-item {
  display: block;
  color: rgba(51, 51, 51, 0.35);
  border: 1px solid transparent;
  border-width: 1px 0;
  line-height: 1;
  text-align: left;
  padding: 6.66666667px 10px;
}
.go-plus-panel .panel-nav-item:hover {
  color: #333;
}
.go-plus-panel .panel-nav-item:active,
.go-plus-panel .panel-nav-item.is-selected {
  color: rgba(255, 255, 255, 0.8);
  border-color: rgba(0, 0, 0, 0.1);
  background-color: #fff;
}
.go-plus-panel .panel-nav-item:first-child {
  border-top: 0;
}
.go-plus-panel .panel-icon-button {
  color: inherit;
  padding: 0;
  border: none;
  background-color: transparent;
  cursor: default;
}
.go-plus-panel .panel-icon-button + .panel-icon-button {
  margin-left: 10px;
}
.go-plus-panel .panel-icon-button:hover {
  color: #333;
}
.go-plus-panel .panel-icon-button:active {
  color: rgba(51, 51, 51, 0.35);
}
.go-plus-panel .panel-icon-button:before {
  margin-right: 0;
}
.go-plus-panel .panel-body {
  position: relative;
  overflow: auto;
  display: flex;
  flex: 1;
  min-height: 0;
  background-color: #fff;
  -webkit-user-select: text;
}
.go-plus-panel .go-plus-empty-tab {
  display: flex;
  margin: auto;
  font-size: 1.5em;
  font-weight: bold;
  align-items: center;
  justify-content: center;
  text-align: center;
}
.go-plus-panel .go-plus-panel-body {
  font-family: var(--editor-font-family);
  font-size: var(--editor-font-size);
  line-height: var(--editor-line-height);
}
.go-plus-panel .padded-content {
  padding: 10px;
}
.go-plus-panel .content {
  padding: 0px;
}
